def tabelaSlr():
	tabela = []
	with open('tabela.csv','r') as f:
		for line in f:
			linha = line.split(';')
			for num,cel in enumerate(linha):
				if cel == 'v':
					linha[num] = ''
			linha.pop(0)
			linha.pop(len(linha)-1)
			tabela.append(linha)
	return tabela


